app_version: 1.0.0
name: Sooty 
description: A test app made for replicate Sooty functions
contact_info:
  name: "@frikkylikeme"
  url: https://shuffler.io
  email: frikky@shuffler.io
actions:
  - name: Urlsanitise
    description: Sanitise the url 
    parameters:
      - name: url
        description: url address
        required: true
        multiline: false
        example: 'https://www.amazon.com/gp/help/customer/display.html?nodeId=508510&ref_=nav_cs_customerservice'
        schema:
          type: string
  - name: UrlDecoder
    description: Decodes url 
    parameters:
      - name: url
        description: url address
        required: true
        multiline: false
        example: 'https://www.amazon.com/gp/help/customer/display.html?nodeId=508510&ref_=nav_cs_customerservice'
        schema:
          type: string
  - name: SafelinksDecoder
    description: Decodes url 
    parameters:
      - name: url
        description: url address
        required: true
        multiline: false
        example: 'https://www.amazon.com/gp/help/customer/display.html?nodeId=508510&ref_=nav_cs_customerservice'
        schema:
          type: string
  - name: UnshortenUrl
    description: Unshortens given url if possible
    parameters:
      - name: url
        description: url address
        required: true
        multiline: false
        example: 'https://tinyurl.com/44htyfzf'
        schema:
          type: string
  - name: Cisco7Decoder
    description: Cisco Password 7 Decoder
    parameters:
      - name: password
        description: Cisco Password 7
        required: true
        multiline: false
        example: '02031C5A06160324'
        schema:
          type: string
  # - name: ReverseDnsLookup
  #   description: Reverse DNS Lookup
  #   parameters:
  #     - name: ip
  #       description: Ip address
  #       required: true
  #       multiline: false  
  #       example: '192.168.1.1'
  #       schema:
  #         type: string
  - name: DnsLookup
    description: DNS Lookup
    parameters:
      - name: domainname
        description: Enter domainname
        required: true
        multiline: false
        example: 'tp-in-f100.1e100.net'
        schema:
          type: string
  - name: HashText
    description: Hash a text input
    parameters:
      - name: text
        description: Enter a text
        required: true
        multiline: false
        example: 'Hello world'
        schema:
          type: string
  - name: WhoIs
    description: Gives information about Ip
    parameters:
      - name: ip
        description: ip address
        required: true
        multiline: false
        example: '192.168.1.1'
        schema:
          type: string
    returns:
      schema:
        type: string
